package leetcode.lc0438_anagramsinstring;

import org.junit.jupiter.api.Test;

import java.util.List;

import static org.junit.jupiter.api.Assertions.assertArrayEquals;


class SolutionTest {
    @Test
    void example1() {
        String inputS = "cbaebabacd", inputP = "abc";
        int[] expected = {0, 6};
        List<Integer> output = new Solution().findAnagrams(inputS, inputP);

        assertArrayEquals(expected, output.stream().mapToInt(i -> i).toArray());
    }

    @Test
    void example2() {
        String inputS = "abab", inputP = "ab";
        int[] expected = {0, 1, 2};
        List<Integer> output = new Solution().findAnagrams(inputS, inputP);

        assertArrayEquals(expected, output.stream().mapToInt(i -> i).toArray());
    }

    @Test
    void example3() {
        String inputS = "";
        String inputP = "";
        int[] expected = {0, 10001};
        List<Integer> output = new Solution().findAnagrams(inputS, inputP);

        assertArrayEquals(expected, output.stream().mapToInt(i -> i).toArray());
    }
}